import React, { useState } from 'react';
import bg from './bg.png'; // Default background for the card
// Import other images for each card
import cognito from './cognito.png';
import dynamodb from './dynamodb.png';
import s3 from './s3.png';
import amplify from './amplify.png';
import comprehend from './comprehend.png';
import transcribe from './transcribe.png';
import translate from './translate.png';
import iam from './iam.png';

function Services() {
  const [hoveredCard, setHoveredCard] = useState(null);

  const handleMouseEnter = (index) => {
    setTimeout(() => setHoveredCard(index), 100); // Delay state change slightly
  };

  const handleMouseLeave = () => {
    setTimeout(() => setHoveredCard(null), 100); // Delay state reset slightly
  };

  const cardData = [
    { img: cognito, text: 'Cognito' },
    { img: dynamodb, text: 'DynamoDB' },
    { img: s3, text: 'S3' },
    { img: amplify, text: 'Amplify' },
    { img: comprehend, text: 'Comprehend' },
    { img: transcribe, text: 'Transcribe' },
    { img: translate, text: 'Translate' },
    { img: iam, text: 'IAM' }
  ];

  return (
    <div>
      <header>
        <h2>LifeLens</h2>
        <nav
          style={{
            position: 'fixed',
            top: 0,
            left: 0,
            width: '100%',
            height: '80px',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            backgroundColor: 'black',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            zIndex: 1000
          }}
        >
          <div style={lifelens}>LifeLens</div>
          <div style={{ display: 'flex', justifyContent: 'flex-end' }}>
            <div
              style={
                hoveredCard === 'home'
                  ? { ...buttonStyle, ...buttonHoverStyle }
                  : buttonStyle
              }
              onClick={() => (window.location.href = '/home')}
              onMouseEnter={() => handleMouseEnter('home')}
              onMouseLeave={handleMouseLeave}
            >
              HOME
            </div>
            <div
              style={
                hoveredCard === 'about'
                  ? { ...buttonStyle, ...buttonHoverStyle }
                  : buttonStyle
              }
              onClick={() => (window.location.href = '/about')}
              onMouseEnter={() => handleMouseEnter('about')}
              onMouseLeave={handleMouseLeave}
            >
              ABOUT
            </div>
            <div
              style={
                hoveredCard === 'signin'
                  ? { ...buttonStyle, ...buttonHoverStyle }
                  : buttonStyle
              }
              onClick={() => (window.location.href = '/sign-in')}
              onMouseEnter={() => handleMouseEnter('signin')}
              onMouseLeave={handleMouseLeave}
            >
              SIGN IN
            </div>
          </div>
        </nav>
      </header>

      <div
        style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(4, 1fr)',
          gap: '20px',
          justifyItems: 'center',
          padding: '100px 20px 20px'
        }}
      >
        {cardData.map((card, index) => (
          <div
            key={index}
            style={{
              backgroundColor: 'transparent',
              width: '320px',
              height: '254px',
              perspective: '1000px',
              fontFamily: 'sans-serif'
            }}
          >
            <div
              style={{
                position: 'relative',
                width: '100%',
                height: '100%',
                textAlign: 'center',
                transition: 'transform 1s',
                transformStyle: 'preserve-3d',
                transform: index === hoveredCard ? 'rotateY(180deg)' : 'rotateY(0deg)'
              }}
              onMouseEnter={() => handleMouseEnter(index)}
              onMouseLeave={handleMouseLeave}
            >
              <div
                style={{
                  boxShadow: '0 8px 14px 0 rgba(0,0,0,0.2)',
                  position: 'absolute',
                  display: 'flex',
                  flexDirection: 'column',
                  justifyContent: 'flex-start',
                  width: '100%',
                  height: '100%',
                  backfaceVisibility: 'hidden',
                  border: '1px solid #4836bb',
                  borderRadius: '1rem',
                  backgroundImage: `url(${bg})`,
                  backgroundSize: 'cover',
                  overflow: 'hidden',
                  color: 'coral'
                }}
              >
                <img
                  src={card.img}
                  alt="Card"
                  style={{
                    width: '75%',
                    height: '75%',
                    objectFit: 'contain',
                    margin: 'auto',
                    display: 'block'
                  }}
                />
                <p
                  style={{
                    fontSize: '1.5em',
                    fontWeight: '900',
                    textAlign: 'center',
                    margin: 0,
                    height: '25%',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center'
                  }}
                >
                  {card.text}
                </p>
              </div>

              <div
                style={{
                  boxShadow: '0 8px 14px 0 rgba(0,0,0,0.2)',
                  position: 'absolute',
                  display: 'flex',
                  flexDirection: 'column',
                  justifyContent: 'center',
                  width: '100%',
                  height: '100%',
                  backfaceVisibility: 'hidden',
                  border: '1px solid #4836bb',
                  borderRadius: '1rem',
                  backgroundImage: `url(${bg})`,
                  backgroundSize: 'cover',
                  color: 'white',
                  transform: 'rotateY(180deg)'
                }}
              >
                <p
                  style={{
                    fontSize: '1.5em',
                    fontWeight: '900',
                    textAlign: 'center',
                    margin: 0
                  }}
                >
                  BACK
                </p>
                <p>Leave Me</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Services;

const buttonStyle = {
  cursor: 'pointer',
  width: '184px',
  height: '45px',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  gap: '1rem',
  fontSize: '1.125em',
  fontWeight: '800',
  letterSpacing: '2px',
  color: 'black',
  backgroundColor: '#644dff',
  border: '2px solid #4836bb',
  borderRadius: '0.75rem',
  boxShadow: '0 8px 0 #4836bb',
  transform: 'skew(-10deg)',
  transition: 'all 0.1s ease',
  filter: 'drop-shadow(0 15px 20px rgba(101, 77, 255, 0.39))',
  marginTop: '-10px',
  marginRight: '10px'
};

const buttonHoverStyle = {
  letterSpacing: '0px',
  transform: 'skew(-10deg) translateY(8px)',
  boxShadow: '0 0 0 rgba(101, 77, 255, 0.39)'
};

const lifelens = {
  color: '#644dff',
  width: '184px',
  height: '45px',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  gap: '1rem',
  fontSize: '2em',
  fontWeight: '800',
  letterSpacing: '2px',
  marginLeft: '20px'
};
